messages.content:
Here are **specific, actionable improvements** to get the Weapons/Horses landing pages above the fold, strengthen hierarchy, and keep the western aesthetic. Ill reference selectors you likely have (adjust names as needed). Im focusing on **layout density, card sizing, and typography scale**.

---

## 1) Reduce vertical height + tighten spacing
**Goal:** Fit everything without scrolling.

**Changes:**
```css
/* Page wrapper */
.section-landing {
  padding-top: 24px;
  padding-bottom: 24px;
}

/* Title + subtitle block */
.section-landing__header {
  margin-bottom: 16px;
}

/* Tabs/section buttons */
.section-tabs {
  margin: 12px auto 20px;
}

/* Main content card */
.section-card {
  padding: 24px 32px;
}
```

**Why:** Current top spacing eats fold. This brings the core content higher.

---

## 2) Split the card into two columns to reduce height
**Current:** Single column list makes the card too tall.  
**Fix:** Use a twocolumn grid for try one of these prompts.

```css
.section-card__prompt-list {
  display: grid;
  grid-template-columns: repeat(2, minmax(0, 1fr));
  gap: 12px 16px;
}
```

**Why:** Halves the vertical space while keeping all items visible.

---

## 3) Shrink card height by tightening prompt cards
Make each sample prompt smaller (padding + font size).

```css
.section-card__prompt {
  padding: 12px 16px;
  font-size: 14px;
  line-height: 1.35;
}
```

**Why:** Prompts are visually large for the amount of text.

---

## 4) Strengthen visual hierarchy (title + subtitle + CTA)
Make the title stand out and reduce subtitle weight.

```css
.section-card__title {
  font-size: 26px;
  margin-bottom: 6px;
}

.section-card__subtitle {
  font-size: 14px;
  opacity: 0.75;
  margin-bottom: 12px;
}
```

**Why:** Clearer hierarchy without adding vertical bulk.

---

## 5) Add Ask input to weapons/horses pages (optional but improves UX)
The home page has input and action. Add it here to avoid full list only page.  
Place it under the prompt list.

```css
.section-card__input-row {
  margin-top: 16px;
  display: flex;
  gap: 12px;
}
```

**Why:** Keeps consistent with landing and makes the tool immediately useful.

---

## 6) Reduce heading space above the card
The giant title gap pushes the card down.

```css
.section-landing__title {
  margin-top: 10px;
  margin-bottom: 8px;
  font-size: 28px; /* down from current */
}
```

---

## 7) Make the tabs visually tighter and more button-like
The tabs take too much height and read like flat text.

```css
.section-tabs__button {
  padding: 8px 14px;
  font-size: 12px;
  letter-spacing: 1px;
  text-transform: uppercase;
}
```

---

## 8) Align spacing + proportions to match the home page card
On home, the card has a tighter feel. Match that by reducing card width slightly.

```css
.section-card {
  max-width: 920px; /* if currently wider */
  margin: 0 auto;
}
```

---

# Layout Recommendation (Visual)
- **Top:** Back to RDR2 Companion small link
- **Title:** WEAPONS / HORSES
- **Tabs:** smaller row
- **Card:**  
  - Title + subtitle  
  - Try one of these  
  - Two-column prompt grid  
  - Optional input row

---

If you share actual class names, I can map these exactly to your existing structure.
